import styled from 'styled-components';

const SearchBlock = styled.div`
`;
const SearchInput = styled.input`
width:20px;
height:5px;
`
const SearchIcon = styled.img`
width:20px;
height:20px;
`
const SearchButton = styled.button`
width:30px;
height:30px;
`
const SearchBtn = ()=>{

    return <>
    <SearchButton>
        <SearchIcon src={process.env.PUBLIC_URL +"/search-icon.png"}/>
    </SearchButton>

    </>
}

const Search = () => {
  return <SearchBlock >
    <SearchInput/>
    <SearchBtn/>
  </SearchBlock>;
};

export default Search;
